-- ----------------------------
-- Table structure for tb_price
-- ----------------------------
DROP TABLE IF EXISTS `tb_price`;
CREATE TABLE `tb_price`  (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `province` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '省份名称',
  `city` varchar(30) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '城市名称',
  `nightinitial` int(6) NOT NULL DEFAULT 21 COMMENT '夜晚起点,如:21,表示每天的21点开始',
  `nightend` int(6) NOT NULL DEFAULT 6 COMMENT '夜晚结束,如:6,表示每天的6点前算夜晚',
  `initialmeter` float(6, 0) NOT NULL COMMENT '起步公里数',
  `dayinitialprice` float(5, 2) NOT NULL COMMENT '白天起步价钱',
  `nightinitialprice` float(5, 2) NOT NULL COMMENT '夜晚起步价钱',
  `dayincreasemeter` float(6, 0) NOT NULL COMMENT '白天运行里程(米)',
  `dayincreaseprice` float(5, 2) NOT NULL COMMENT '白天运行价钱',
  `nightincreasemeter` float(6, 0) NOT NULL COMMENT '夜晚运行里程(米)',
  `nightincreaseprice` float(5, 2) NOT NULL COMMENT '夜晚运行价钱',
  `highpricemeter` float(6, 0) NOT NULL COMMENT '超过多少米后运价提高',
  `dayhighprice` float(5, 2) NOT NULL COMMENT '超过highpricemeter米后白天提高的运价',
  `nighthighprice` float(5, 2) NOT NULL COMMENT '超过highpricemeter米后夜晚提高的运价',
  `remark` varchar(250) CHARACTER SET utf8 COLLATE utf8_general_ci NULL DEFAULT NULL,
  PRIMARY KEY (`id`) USING BTREE,
  UNIQUE INDEX `city_index`(`city`) USING BTREE
) ENGINE = InnoDB AUTO_INCREMENT = 6 CHARACTER SET = utf8 COLLATE = utf8_general_ci ROW_FORMAT = Compact;

