-- ----------------------------
-- Event structure for 001.driver_integrity_state_evn
-- ----------------------------
DROP EVENT IF EXISTS `001.driver_integrity_state_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `001.driver_integrity_state_evn`
ON SCHEDULE
EVERY '10' MINUTE STARTS '2016-12-31 13:13:41'
DO INSERT INTO tab_driver_integrity(name,sex,kabnum,phone,clientid,isblacklist,integral,callnumber,successnumber,cancelnumber,toaccount,tomileage,tomoney,tovainmileage,promisenumber)

(
SELECT d.name,d.sex,d.kabnum,d.phone,d.clientid,d.isstop,IFNULL(driverorder.eva,3),IFNULL(driverorder.allorder,0) ,IFNULL(driverorder.successorder,0),IFNULL(driverorder.cancelorder,0) ,IFNULL(d.toaccount,0),IFNULL(d.tomileage,0),IFNULL(d.tomoney,0),IFNULL(d.tovainmileage,0),0
FROM 
(SELECT  A.id,A.account,A.pwd,A.msid,A.kabnum,A.`name`,A.sex,A.phone,A.createtime,A.lastlg,A.lastlt,A.gpstime,A.isonline,A.company,A.isstop,A.driverpic,A.drivercardid,A.licenseid,A.operationid,A.serialnum,A.validitydatetime,A.clientid,A.identity,A.terminalid,A.unit,B.toaccount,B.tomileage,B.tomoney,B.tovainmileage
FROM tab_driver A
LEFT JOIN (SELECT tp.account, COUNT(tp.account) as toaccount ,SUM(tp.mileage) as tomileage,SUM(tp.money) as tomoney,SUM(tp.vainmileage) as tovainmileage FROM `tab_payrecords` tp GROUP BY account) B
ON A.account = B.account
ORDER BY A.account DESC) d
LEFT JOIN
(
SELECT o.msid AS drivername , 
COUNT(o.msid ) AS allorder ,
SUM(`status`=4) AS successorder,
SUM(`status`=3 ) AS cancelorder,
SUM(evaluate) AS eva
FROM tab_phonecallbuss o
GROUP BY msid 
ORDER BY COUNT(msid) DESC ) driverorder
ON d.msid = driverorder.drivername
)
on duplicate key update phone = values(phone),isblacklist = values(isblacklist),
integral = values(integral),callnumber = values(callnumber),successnumber = values(successnumber),
cancelnumber = values(cancelnumber),toaccount = values(toaccount),tomileage = values(tomileage),
tomoney = values(tomoney),tovainmileage = values(tovainmileage),promisenumber=VALUES(promisenumber)
;
;;
delimiter ;

-- ----------------------------
-- Event structure for 002.passeger_integrity_state_evn
-- ----------------------------
DROP EVENT IF EXISTS `002.passeger_integrity_state_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `002.passeger_integrity_state_evn`
ON SCHEDULE
EVERY '10' MINUTE STARTS '2016-12-31 13:14:29'
DO INSERT INTO tab_passenger_integrity(phone,name,sex,callnumber,successnumber,cancelnumber,registrationtime,islock,promisenumber,integral,clientid) 
 
(
SELECT passorder.phone ,IFNULL(p.`name`,passorder.phone),IFNULL(p.sex,0) ,IFNULL(passorder.allorder,0)  ,IFNULL(passorder.successorder,0) ,IFNULL(passorder.cancelorder,0) ,IFNULL(p.createdate,NULL),IFNULL(p.islock,0),0,0,passorder.clientid
FROM tab_phoneuser p
RIGHT JOIN
(

SELECT  o.clientmobile as phone,
    COUNT(opruser) AS allorder ,
SUM(`status`=4) AS successorder,
SUM(`status`=3) AS cancelorder,
o.enterpriseid AS clientid
FROM tab_phonecallbuss o
WHERE o.enterpriseid IS NOT NULL
AND o.clientmobile REGEXP "^[1][35678][0-9]{9}$"
GROUP BY o.clientmobile 
ORDER BY COUNT(opruser) DESC
) passorder
ON passorder.phone =  p.`name`
WHERE passorder.clientid IS NOT NULL
)
on duplicate key update phone = values(phone),callnumber = values(callnumber),
successnumber = values(successnumber),cancelnumber = values(cancelnumber),islock = values(islock),
promisenumber = values(promisenumber),integral = VALUES(integral)
;
;;
delimiter ;

-- ----------------------------
-- Event structure for 003.operat_statis_evn
