DROP EVENT IF EXISTS `003.operat_statis_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `003.operat_statis_evn`
ON SCHEDULE
EVERY '10' MINUTE STARTS '2016-12-31 13:15:31'
DO INSERT INTO tab_operat_statis(kabnum,`name`,enterprise,passmile,emptymile,amount )  
(
	SELECT A.kabnum,A.`name`,A.clientid,IFNULL(B.tomileage,0),IFNULL(B.tomoney,0),IFNULL(B.tovainmileage,0)
	FROM tab_driver A
	LEFT JOIN (SELECT  tp.account, tp.geton,tp.getoff, COUNT(tp.account) as toaccount ,SUM(tp.mileage) as tomileage,SUM(tp.money)  as tomoney,SUM(tp.vainmileage) as tovainmileage 
	FROM `tab_payrecords` tp GROUP BY account) B
	ON A.account = B.account
	ORDER BY B.tomoney DESC
)

on duplicate key update kabnum = values(kabnum),
passmile = values(passmile),emptymile = values(emptymile),amount = values(amount)
;
;;
delimiter ;

-- ----------------------------
-- Event structure for 004.driver_ser_statis_evn
-- ----------------------------
DROP EVENT IF EXISTS `004.driver_ser_statis_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `004.driver_ser_statis_evn`
ON SCHEDULE
EVERY '10' MINUTE STARTS '2016-12-31 13:16:32'
DO INSERT INTO tab_driver_ser_statis(account,kabnum,evaluationnum,starnum_5,starnum_4,starnum_3,starnum_2,starnum_1,nostarnum,clientid )  
	(
		SELECT t1.`name`,t1.kabnum,IFNULL(t2.evanum,0),IFNULL(t2.eva5,0),IFNULL(t2.eva4,0),IFNULL(t2.eva3,0),IFNULL(t2.eva2,0),IFNULL(t2.eva1,0),IFNULL(t2.evanull,0),t1.clientid
		FROM tab_driver t1
		LEFT JOIN 
		(
		SELECT msid ,
		COUNT(evaluate) as evanum,
		SUM(evaluate =5) AS eva5,
		SUM(evaluate =4) AS eva4,
		SUM(evaluate =3) AS eva3,
		SUM(evaluate =2) AS eva2,
		SUM(evaluate =1) AS eva1,
		SUM(evaluate IS NULL) AS evanull
		FROM tab_phonecallbuss
		WHERE msid IS NOT NULL
		GROUP BY msid
		) t2
		on t1.msid = t2.msid
		ORDER BY t2.evanum DESC
	)
	on duplicate key update evaluationnum = values(evaluationnum),
	kabnum = values(kabnum),starnum_5 = values(starnum_5),starnum_4 = values(starnum_4),
	starnum_3 = values(starnum_3),starnum_2 = values(starnum_2),starnum_1 = values(starnum_1),
	nostarnum= values(nostarnum )
;
;;
delimiter ;

