-- ----------------------------
-- Event structure for 010.operating_situation_evn
-- ----------------------------
DROP EVENT IF EXISTS `010.operating_situation_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `010.operating_situation_evn`
ON SCHEDULE
EVERY '10' MINUTE STARTS '2016-12-31 13:20:05'
DO INSERT INTO tab_operating_situation(enterprise,totalnum,emptynum,heavynum,totaloperat,passmiles,totalrevenue)  
(
	SELECT d.clientid,COUNT(d.clientid),0,0,ifnull(SUM(driverorder.successorder),0),ifnull(SUM(d.tomileage),0),ifnull(SUM(d.tomoney),0)
	FROM 
	(SELECT  A.id,A.account,A.pwd,A.msid,A.kabnum,A.`name`,A.sex,A.phone,A.createtime,A.lastlg,A.lastlt,A.gpstime,A.isonline,A.company,A.isstop,A.driverpic,A.drivercardid,A.licenseid,A.operationid,A.serialnum,A.validitydatetime,A.clientid,A.identity,A.terminalid,A.unit,A.driveridentityPic,A.drivingPic,A.kabnumid,B.toaccount,B.tomileage,B.tomoney,B.tovainmileage
	FROM tab_driver A
	LEFT JOIN (SELECT tp.account, COUNT(tp.account) as toaccount ,SUM(tp.mileage) as tomileage,SUM(tp.money) as tomoney,SUM(tp.vainmileage) as tovainmileage FROM `tab_payrecords` tp GROUP BY account) B
	ON A.account = B.account
	ORDER BY A.account DESC) d
	LEFT JOIN
	(
	SELECT 
	o.msid AS drivername , 
	COUNT(o.msid ) AS allorder ,
	SUM(`status`=4 and msid=o.msid)  AS successorder,
	SUM(`status`=3 and msid=o.msid) AS cancelorder
	FROM tab_phonecallbuss o
	GROUP BY msid 
	ORDER BY COUNT(msid) DESC ) driverorder
	ON d.msid = driverorder.drivername
	GROUP BY clientid
)

on duplicate key update enterprise = values(enterprise),totalnum = values(totalnum),emptynum = values(emptynum),heavynum = values(heavynum),
totaloperat = values(totaloperat),passmiles = values(passmiles),totalrevenue = values(totalrevenue)
;
;;
delimiter ;

