-- ----------------------------
-- Event structure for driver_integrity_state_evn
-- ----------------------------
DROP EVENT IF EXISTS `driver_integrity_state_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `driver_integrity_state_evn`
ON SCHEDULE
EVERY '1' DAY STARTS '2016-09-23 00:00:00'
DISABLE
DO INSERT INTO tab_driver_integrity(name,sex,kabnum,phone,enterprise,callnumber,successnumber,cancelnumber) 
 
(SELECT d.name,d.sex,d.kabnum,d.phone,d.company,driverorder.allorder,driverorder.successorder,driverorder.cancelorder 
FROM tab_driver d
JOIN
(
SELECT o.msid AS drivername , COUNT(o.msid ) AS allorder ,
(SELECT COUNT(billid) FROM `tab_phonecallbuss`WHERE `status`=4 and msid=o.msid) AS successorder,
(SELECT COUNT(billid) FROM `tab_phonecallbuss`WHERE `status`=3 and msid=o.msid) AS cancelorder
FROM tab_phonecallbuss o
GROUP BY msid 
ORDER BY COUNT(msid) DESC ) driverorder
ON d.msid = driverorder.drivername
)
on duplicate key update phone = values(phone)
;
;;
delimiter ;

-- ----------------------------
-- Event structure for order_callbuss_state_evn
-- ----------------------------
DROP EVENT IF EXISTS `order_callbuss_state_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `order_callbuss_state_evn`
ON SCHEDULE
EVERY '3' SECOND STARTS '2016-09-23 00:00:00'
DO INSERT INTO tab_callbuss_stat(allorder,neworder,processingorder,cancelorder,finishorder,neatnotcar,outtimeorder,onlinecar,offlinecar) VALUES 
(

(	SELECT COUNT(billid) FROM tab_phonecallbuss WHERE calltime > date(NOW())), 
( SELECT COUNT(billid) FROM `tab_phonecallbuss` p WHERE (p.`status` =0 OR p.`status` = 1) AND p.calltime > date(NOW()) ), 
( SELECT COUNT(billid) FROM `tab_phonecallbuss` p WHERE p.`status` = 2 AND p.calltime > date(NOW())) , 
( SELECT COUNT(billid) FROM `tab_phonecallbuss` p WHERE p.`status` = 3 AND p.calltime > date(NOW()) ), 
( SELECT COUNT(billid) FROM `tab_phonecallbuss` p WHERE p.`status` = 4 AND p.calltime > date(NOW()) ) ,
( SELECT COUNT(billid) FROM `tab_phonecallbuss` p WHERE p.`status` = 5 AND p.calltime > date(NOW()) ) ,
( SELECT COUNT(count)  FROM (SELECT TIMESTAMPDIFF(MINUTE,calltime, now()) as count FROM tab_phonecallbuss  WHERE calltime > date(NOW()) AND (`status` =0 OR `status` = 1))  t where t.count>30), 
(SELECT COUNT(DISTINCT kabnum) FROM `tab_driver` WHERE isonline=1),
(SELECT COUNT(DISTINCT kabnum) FROM `tab_driver` WHERE isonline=0)

)
;
;;
delimiter ;

