-- ----------------------------
-- Event structure for passeger_integrity_state_evn
-- ----------------------------
DROP EVENT IF EXISTS `passeger_integrity_state_evn`;
delimiter ;;
CREATE DEFINER = `root`@`%` EVENT `passeger_integrity_state_evn`
ON SCHEDULE
EVERY '6' HOUR STARTS '2016-09-23 14:26:53'
DISABLE
DO INSERT INTO tab_passenger_integrity(phone,name,sex,callnumber,successnumber,cancelnumber,registrationtime) 
 
(
SELECT p.mobile as phone,p.`name`AS passname,p.sex AS sex,passorder.allorder AS callnumber ,passorder.successorder AS successnumber,passorder.cancelorder AScancelnumber,p.createdate
FROM tab_phoneuser p
JOIN
(SELECT  o.opruser as passname,COUNT(opruser) AS allorder ,
(SELECT COUNT(billid) FROM `tab_phonecallbuss`WHERE `status`=4 and opruser=o.opruser) AS successorder,
(SELECT COUNT(billid) FROM `tab_phonecallbuss`WHERE `status`=3 and opruser=o.opruser) AS cancelorder
FROM tab_phonecallbuss o
GROUP BY opruser 
ORDER BY COUNT(opruser) DESC) passorder
ON passorder.passname =  p.`name`
)
on duplicate key update phone = values(phone)
;
;;
delimiter ;

