INSERT INTO `tb_price` VALUES (1, '广东', '肇庆市', 21, 7, 1000, 7.00, 7.00, 260, 0.50, 200, 0.50, 0, 0.00, 0.00, '广宁县天隆汽车出租有限公司 出租车  日，夜（21:00至次日7:00）打表价格标准：\r\n起步价：日夜执行统一标准  7元/公里。\r\n运行价：白天 行驶 260 米跳一次表 每次0.5元。夜间 行驶 200米跳一次表，每次0.5元。\r\n候车费：每小时30元，每一分钟加收0.5元，不足5分钟不记收。\r\n打表计价范围：县城范围内，东至广宁第一中学，南至广东鼎丰纸业有限公司广宁分公司，西至东乡桥，北至牛角坳，超出上述范围经营者可以打表收费，也可以议价收费，有经营者与乘客协商定价\r\n');
INSERT INTO `tb_price` VALUES (2, '江西', '上饶', 21, 6, 1400, 7.00, 10.00, 1000, 1.60, 1000, 1.90, 4000, 2.30, 2.80, '余干  白天（早上6点到晚21点），起步1.5公里3元调整为1.4公里4元，4公里以内由每公里1.4元调整为每公里1.6元， 4公里以外由每公里2.1元调整为每公里2.3元.\r\n夜间（晚21点到次日早上6点）：起步价1.4公里4元，调整为1.4公里6元. 4公里以内由每公里1.6元调整为每公里1.9元. 4公里以外由每公里2.4元调整为每公里2.8元.\r\n③免费等候时间为5分钟,车辆起步超100米以后自动取消,然后按2.5分种1元收取等候费.\r\n出城或下乡可由乘客自愿选择打表计价或面议包车。');
